	INSERT INTO temp_bln (SELECT DISTINCT MONTH(tgl_peminjaman) FROM tbl_peminjaman WHERE (tgl_peminjaman BETWEEN @tgl_mulai AND @tgl_akhir) ORDER BY YEAR(tgl_peminjaman) ASC, MONTH(tgl_peminjaman) ASC);
	INSERT INTO temp_gedung (`gedung`) (SELECT DISTINCT SUBSTR(nama_ruangan_id, 1, 1) FROM tbl_peminjaman WHERE (tgl_peminjaman BETWEEN @tgl_mulai AND @tgl_akhir) AND nama_ruangan_id NOT IN('%Lab. Teknik Sipil%','%Lab. Teknik Elektro%','%Kelas Khusus%', 'Studio Gambar') AND jadwal_kuliah_id IN(SELECT id FROM tbl_jadwal_perkuliahan WHERE semester_id IN(SELECT id FROM tbl_semester WHERE tahun_ajaran=thn_ajaran)) ORDER BY YEAR(tgl_peminjaman) ASC, MONTH(tgl_peminjaman) ASC);
