CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_gen_current_available_class` ()  BEGIN
		
	SET @semester = (SELECT id FROM tbl_semester
		WHERE NOW() BETWEEN semester_mulai AND semester_akhir
		LIMIT 1);
	
	SELECT id, hari, nama_ruangan_id, matakuliah, nama_dosen, jam_mulai FROM tbl_jadwal_perkuliahan
		WHERE semester_id = @semester
		AND hari = func_convert_hari(WEEKDAY(NOW()))
		AND CURRENT_TIME() BETWEEN (jam_mulai - INTERVAL 1 HOUR) AND (jam_mulai + INTERVAL 2 HOUR + INTERVAL 30 MINUTE)
        ORDER BY nama_ruangan_id ASC;
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_gen_dashboard_data` (IN `thn_ajaran` VARCHAR(35))  BEGIN

	SET @tgl_mulai = (SELECT semester_mulai FROM tbl_semester WHERE tahun_ajaran = thn_ajaran ORDER BY semester_mulai ASC LIMIT 1);
	SET @tgl_akhir = (SELECT semester_akhir FROM tbl_semester WHERE tahun_ajaran = thn_ajaran ORDER BY semester_akhir DESC LIMIT 1);
	
	CREATE TEMPORARY TABLE temp_bln (month int);
	
	CREATE TEMPORARY TABLE temp_gedung (id INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY, gedung varchar(5));
	SET @counter = (SELECT COUNT(gedung) FROM temp_gedung);
	SET @statement = '';
	
	IF @counter > 1 THEN
		SET @statement = 'SELECT a.month,';
		SET @i = 0;
		SET @char = 98;
		
		WHILE (@i < @counter) DO
			SET @statement = CONCAT(@statement, 'IFNULL(',CHAR(@char), '.tot, 0) AS tot', CHAR(@char-33));
			IF @i + 1 < @counter THEN
				SET @statement = CONCAT(@statement,',');
			END IF;
			SET @i = @i + 1;
			SET @char = @char +1;
		END WHILE;
		
		SET @statement = CONCAT(@statement, ' FROM temp_bln a LEFT JOIN');
		SET @i = 0;
		SET @char = 98;
		WHILE (@i < @counter) DO
			SET @tipe_gedung = (SELECT gedung FROM temp_gedung WHERE id = @i+1);
			SET @statement = CONCAT(@statement, ' (', func_gen_txt_gedung(@tipe_gedung, @tgl_mulai, @tgl_akhir, thn_ajaran), ') AS ', CHAR(@char), ' ON a.month = ', CHAR(@char), '.month');
			IF @i + 1 < @counter THEN
				SET @statement = CONCAT(@statement,' LEFT JOIN');
			END IF;
			SET @i = @i + 1;
			SET @char = @char +1;
		END WHILE;
	ELSE
		SET @statement = func_gen_txt_gedung('A', @tgl_mulai, @tgl_akhir, thn_ajaran);
	END IF;
	PREPARE stmt1 FROM @statement;
	EXECUTE stmt1;
	DEALLOCATE PREPARE stmt1;
	
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_peminjaman` (IN `id_ruangan` VARCHAR(5), IN `dosen` VARCHAR(255), IN `jadwal_kuliah` BIGINT(20), `nama_staff` VARCHAR(255))  BEGIN
	SET @row_count = (SELECT COUNT(*) FROM tbl_ruangan WHERE nama_ruangan = id_ruangan AND status_ruangan_id = 1);
	SET @chk_new = (SELECT COUNT(*) FROM tbl_peminjaman WHERE nama_ruangan_id = id_ruangan ORDER BY tgl_peminjaman DESC LIMIT 1);

	IF (@row_count > 0) THEN
		UPDATE tbl_ruangan
		SET status_ruangan_id = 2
		WHERE nama_ruangan = id_ruangan AND status_ruangan_id = 1;
		
		UPDATE tbl_atk
		SET status_atk_id = 2
		WHERE nama_ruangan_id = id_ruangan AND status_atk_id = 1;
		
		
        SELECT '1' as result;
	ELSE
		SELECT '0' as result;
	END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pengembalian` (IN `id_ruangan` VARCHAR(5), `dosen` VARCHAR(255), `chk_list_data` VARCHAR(255), `ket` TEXT, `nama_staff` VARCHAR(255))  BEGIN
	SET @row_count = (SELECT COUNT(*) FROM tbl_ruangan WHERE nama_ruangan = id_ruangan AND status_ruangan_id = 2);
	SET @atk_count = (SELECT COUNT(*) FROM tbl_tipe_atk);
	SET @i = 1;
	SET @kode = (SELECT id FROM tbl_peminjaman WHERE nama_ruangan_id = id_ruangan AND id NOT IN(SELECT peminjaman_id FROM tbl_pengembalian WHERE nama_ruangan_id = id_ruangan) ORDER BY tgl_peminjaman DESC LIMIT 1);
	
	IF (@row_count > 0) THEN
		UPDATE tbl_ruangan
		SET status_ruangan_id = 1
		WHERE nama_ruangan = id_ruangan AND status_ruangan_id = 2;
		
		WHILE @i < @atk_count+1 DO
			
			SET @sub_str = (SUBSTRING_INDEX(SUBSTRING_INDEX(chk_list_data, ',', @i),',',-1));
			SET @atk_id = (SUBSTRING_INDEX(@sub_str,':',1));
			SET @checked = (SUBSTRING_INDEX(@sub_str,':',-1));
			UPDATE tbl_atk
			SET status_atk_id = CASE @checked
								WHEN 1 THEN 1
								WHEN 0 THEN 3
							 END
			WHERE nama_ruangan_id = id_ruangan AND id = @atk_id AND status_atk_id = 2;
			SET @i = @i +1;
			
		END WHILE;
		
		
		SELECT '1' as result;
	ELSE
		SELECT '0' as result;
	END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_pengembalian_hilang` (IN `atk_count` INT(5), `chk_list_data` VARCHAR(255), `nama_staff` VARCHAR(255))  BEGIN
	SET @i = 1;

	WHILE @i < atk_count+1 DO
		
