CREATE DEFINER=`root`@`localhost` FUNCTION `func_convert_hari` (`hari` INT) RETURNS VARCHAR(25) CHARSET latin1 READS SQL DATA
BEGIN
	SET @re = '';
	CASE hari 
		WHEN 0 THEN
			SET @re = 'Senin';
		WHEN 1 THEN
			SET @re = 'Selasa';
		WHEN 2 THEN
			SET @re = 'Rabu';
		WHEN 3 THEN
			SET @re = 'Kamus';
		WHEN 4 THEN
			SET @re = 'Jumat';
		WHEN 5 THEN
			SET @re = 'Sabtu';
		ELSE
			SET @re = 'Minggu';
	END CASE;
	RETURN @re;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `func_gen_txt_gedung` (`gedung` VARCHAR(5), `tgl_mulai` DATETIME, `tgl_akhir` DATETIME, `thn_ajaran` VARCHAR(35)) RETURNS TEXT CHARSET latin1 READS SQL DATA
BEGIN
	
	SET @head = 'SELECT MONTH(tgl_peminjaman) as month, COUNT(id) as tot
			FROM tbl_peminjaman 
			WHERE nama_ruangan_id NOT IN(\'%Lab. Teknik Sipil%\', \'%Lab. Teknik Elektro%\', \'%Kelas Khusus%\', \'Studio Gambar\')
			AND jadwal_kuliah_id IN(SELECT id FROM tbl_jadwal_perkuliahan WHERE semester_id IN(SELECT id FROM tbl_semester WHERE tahun_ajaran=\'';
	SET @mid = ' AND SUBSTR(nama_ruangan_id, 1, 1) = \'';
	SET @foot = ' GROUP BY MONTH(tgl_peminjaman)
			ORDER BY MONTH(tgl_peminjaman) ASC';
	RETURN (CONCAT(@head, thn_ajaran, '\'))', @mid, gedung, '\' AND (tgl_peminjaman BETWEEN \'', tgl_mulai,'\' AND \'', tgl_akhir, '\')',@foot));
END$$

